import { StyleSheet, Button, View } from 'react-native';

import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();

/**
 * Component used to redirect user in other screen
 * @param {String} name Name of the menu
 * @param {String} route Route to redirect on click
 * @returns 
 */
function MenuButton({ name }) {
    return (
        <View style={styles.menuButton}>
            <Button title={name}></Button>
        </View>
    );
}

function HomeScreen() {
    return (
        <View>
            <Text>Welcome !</Text>
            <View style={styles.home_menu}>
                <MenuButton name="menu a"></MenuButton>
                <MenuButton name="menu b"></MenuButton>
                <MenuButton name="menu b"></MenuButton>
                <MenuButton name="menu b"></MenuButton>
                <MenuButton name="menu b"></MenuButton>
            </View>
        </View>
    );
}


export default function App() {
  return (
      <NavigationContainer>
          <Stack.Navigator screenOptions={{
              headerShown: false
            }}>
              <Stack.Screen name="Home" component={HomeScreen} />
          </Stack.Navigator>
      </NavigationContainer>
  );
}

const styles = StyleSheet.create({
    home_menu: {
        flex: 1,
        flexWrap: 'wrap',
        flexDirection: "row",
        alignItems: 'center'
    },
    menuButton: {
        flexBasis: "50%"
    }
});
